function Movies({ movies }) {
  return (
    <ul>
      {movies?.map((movie) => (
        <Movie
          key={movie.imdbID}
          id={movie.imdbID}
          alt={movie.Title}
          title={movie.Title}
          year={movie.Year}
          src={movie.Poster}
        />
        // <li key={movie.imdbID}>
